import React, { Component } from "react";
import { Link } from "react-router-dom";
 import  '../../components/auth/Login.css'
 import logo from "../../images/r3.png";
 import {
	Collapse,
	Navbar,
	NavbarToggler,
	NavbarBrand,
	Nav,
	NavItem,
	NavLink
} from 'reactstrap'
import '../../NavHeader.css'

class Landing extends Component {
  constructor(props) {
		super(props);

		this.toggle = this.toggle.bind(this);
		this.state = {
			isOpen: false
		};
	}

	toggle() {
		this.setState({
			isOpen: !this.state.isOpen
		});
	}

  render() {
    return (
      <div>
      <div  className="wrapper1">
        <div className="form-wrapper">
            <h1>
              <b>RHYTHM</b>
            </h1>

            <br />
            <p>Welcome to Rhythm Music App demo.This websites includes "Register-Page","Login-Page"<br/>
            And a Songlist to Play.</p>

        </div>
        <div className="semi-transparent-button" style={{marginTop:"40px"}}>
              <Link
                to="/home"

              >
               Play Now
              </Link>
            </div>
        </div>
          <div className="createAccount button">
              <Link
                to="/register"

              >
                Register
              </Link>
            </div>

            <div className="fl_fb">
              <Link
                to="/login"

              >
                 <span class="fbicon"><i class="fa fa-facebook"></i></span>
              </Link>
            </div>
            <div>

          </div>
     </div>
    );
  }
}

export default Landing;
